import { Routes,Route } from 'react-router-dom';
import './App.css';
import Contact from './Components/Content/Pages/Contact';
import Index from './Components/Home/Index';


function App() {
  return (
    <>
    <Routes>
      <Route path="/" element={<Index/>}/>
      <Route path="/" element={<Contact/>}/>
    </Routes>
    </>
  );
}

export default App;
